import React, { useContext } from "react";
import { Link } from "react-router-dom";

function CaseStudy() {
  const handleGoBack = () => {
    this.props.history.back();
  };
  return (
    <div>
      <button onClick={handleGoBack}>history</button>

      <h3>CASE SCREEN WORKING</h3>
    </div>
  );
}

export default CaseStudy;
